 import Table from "../../components/Table/Table";

import img6 from '../../assets/images/img6.png';
import img7 from '../../assets/images/img7.png';
import img8 from '../../assets/images/img8.png';
import img9 from '../../assets/images/img9.png';
import { Link} from 'react-router-dom';

import Descripcion from "../../components/Descripcion/Descripcion";


let lugar = [
    {
        texto: 'Las pruebas de Usabilidad se centraron en evaluar la experiencia, áreas de oportunidad y buenas prácticas de la iniciativa de pago de servicios por la aplicación móvil de banco.',
        tiempo: 'Prueba de Usabilidad',        
    },
];

export default function Telefoniainfo() {
    return (
        <div>
            <div className="container my-3">
            <h1 className="titulo2">Telefonía Móvil</h1>
                <div className="col-sm">
                    <div className="lugar">
                        {lugar.map((descripcion, index) => {
                            return (
                                <Descripcion
                                    key={index}                                                                      texto={descripcion.texto}
                                    tiempo={descripcion.tiempo}
                                    precio={descripcion.precio}
                                    costo={descripcion.costo}
                                >
                                </Descripcion>
                            );
                        })}
                    </div>                    
                </div>

               
                <div className="row my-3">
                    <p className="texto1">Los objetivos que se tomaron en cuenta al momento de realizar la recarga, fueron:</p>
                    <ul className="texto1 mx-3">
                        <li>Evaluar la percepción de los usuarios.</li>
                        <li>Determinar las emociones que experimentan los usuarios.</li>
                        <li>Analizar la comprensión del contenido mostrado en las pantallas y evaluar si la cantidad de información es adecuada y comprensible.</li>
                        <li>Identificar en que contextos los usuarios usan el servicio</li>
                        <li>Evaluar su facilidad de uso y sus posibles dificultades de navegación en el flujo.</li>
                        <li>Analizar la satisfacción de los usuarios con cada pantalla presentada.</li>
                        
                    </ul>
                    
                    <div className="row my-3">                   
                    <h2 className="titulo6">Metodología</h2>
                    <p className="texto1">Se realizó una prueba de usabilidad virtual en base a un protocolo preparado con las preguntas elaboradas según los objetivos propuestos, para ello se precisó de 5 personas usuarias entre 18 a 25 años que utilicen la opción de recarga por medio de una app de banco. Posteriormente se consolidó la información a través de material audiovisual y escrito, por medio de notas registradas acerca de las opiniones y quotes de los usuarios, lo que permitió realizar el proceso de análisis.  </p>  
                    <img src={img6} alt="Disney3" className="img-fluid" width="300"/>
                    <p className="texto1"><small>Notas de las opiniones de los usuarios</small></p>
                    </div> 


                    <div className="row my-3 ">
                        
                           <div className="col-sm my-3">
                            <p className="texto1 ">  Comenzamos por explorar la aplicación de Airbnb, continuando por realizar una evaluación individual y otra grupal, ambas  con base a los parámetros de Heurísticas y leyes establecidas en el ámbito de la usabilidad, lo que también incluye el Diseño Visual y la forma de comunicar ideas a través de los textos empleados en el flujo. 
Posteriormente se discutieron los hallazgos encontrados, para clasificarlos con base en la Escala de Severidad planteada por David Travis (2009). Este método permite identificar aquellas áreas en las que se necesita poner especial atención, pues el impacto en el usuario es significativo. Finalmente se buscaron referentes de plataformas web que aplican las buenas prácticas que se proponen como solución a los puntos de mejora. </p>
                           </div> 
                           <div className="col-sm my-3 text-center">
                            <img src={img6} alt="Disney3" className="img-fluid" width="300"/>
                            <p className="texto1"><small>5 fases de evaluación</small> </p>
                           </div> 
                           <p className="texto1">Se identificaron 10 hallazgos de los cuales actontinuación se desglosa un punto de mejora y una buena práctica para un mejor entendimiento.</p>                 
                         
                </div>      
                                          
                </div>

            </div>
       
            <div className="container">
                   <div className="row">
                    <h2 className="titulo6">Tarea re</h2>
                    <p className="texto1"> La plataforma de AirBnb cuenta con servicios únicoos y destacables, sin embargo también se encontraron áreas de mejora entorno a las leyes de usabilidad y las heurísticas que podrñian limitar la navegación de la plataforma por parte de los usuarios e incrementar la tas de abandono. </p> 
                      </div>
            </div>





            <div className="container my-3">
                <div className="row">
                    <div className="col-sm my-3">
                        <Link to="/">   <button className="btn btn-primary"> Volver al menú</button></Link>
                    </div>
                    <div className="col-sm my-3">
                        <Link to="/UX/UI">   <button className="btn btn-primary"> Siguiente</button></Link>
                       
                    </div>
                </div>
            </div>
             
          
            
        </div>
    );

}
